import React from 'react';

import './checkout.styles.scss';

const CheckoutPage = () => {
	return (
		<div className='checkout-page'>
			<div className='checkout-header'>
				<div className='checkout-block'>
					<span>Product</span>
				</div>
				<div className='checkout-block'>
					<span>Description</span>
				</div>
				<div className='checkout-block'>
					<span>Quantity</span>
				</div>
				<div className='checkout-block'>
					<span>Price</span>
				</div>
				<div className='checkout-block'>
					<span>Remove</span>
				</div>
			</div>
		</div>
	);
};

export default CheckoutPage;
